import React from 'react';
import './NavBar.css';

import { Link } from 'react-scroll';

function NavBar() {

    return (
        <div className='nav-bar'>
            <h1 className='title'>Ryan Slevin</h1>
            <Link className='nav-btn' to='educationContainer' spy={true} smooth={true} duration={500}>Education</Link>
            <Link className='nav-btn' to='projectsContainer' spy={true} smooth={true} duration={500}>Projects</Link>
            <Link className='nav-btn' to='contactContainer' spy={true} smooth={true} duration={500}>Contact</Link>
        </div>
    )

    }

export default NavBar;
